import React from "react";

const TimelineItem = ({ el }) => (
  <div className="timeline-item px-5 ">
    <div className="timeline-item-content">
      <div className={el.isComplete?"circle-tick":"circle"}></div>
      <p>{el.name}</p>
      <p>{el.description}</p>
      <time>{el.date}</time>
    </div>
  </div>
);

export default TimelineItem;
